import React from "react";
import Logo from "../img/Logo.png";

// Flex (List)
// Grid (WPF)

function Search() {
  return (
    <div>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <div style={{ flex: 1, backgroundColor: "red", height: 100 }} />
        <div style={{ flex: 1, backgroundColor: "blue", height: 100 }} />
        <div style={{ flex: 1, backgroundColor: "green", height: 100 }} />
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          padding: "0px 24px",
        }}
      >
        <img src={Logo} style={{ width: "400px", height: "150px" }} />
        <input
          style={{
            flex: 1,
            maxWidth: "600px",
            height: "52px",
            border: "solid 2px #19ce60",
            borderRadius: "3px",
            fontWeight: "bold",
            fontSize: "18px",
          }}
        />
      </div>
      <div style={{ backgroundColor: "green", marginTop: 100 }}>
        <img
          src={Logo}
          style={{ backgroundColor: "red", width: "400px", height: "150px" }}
        />
        <input style={{ width: "600px", height: "52px" }} />
      </div>
    </div>
